import React from "react";
import "./App.css";
import DivBlock from "./componets/Blocks";

class App extends React.Component {
  state = {
    blocks: [
      {
        key: 15,
      },
      {
        key: 2,
      },
      {
        key: 1,
      },
      {
        key: 12,
      },
      {
        key: 8,
      },
      {
        key: 5,
      },
      {
        key: 6,
      },
      {
        key: 11,
      },
      {
        key: 4,
      },
      {
        key: 9,
      },
      {
        key: 10,
      },
      {
        key: null,
      },
      {
        key: 3,
      },
      {
        key: 14,
      },
      {
        key: 13,
      },
      {
        key: 7,
      },
    ],
  };

  moveToNull = (index) => {
    const blocks = this.state.blocks;
    blocks[index] = null;
    console.log("works");
    this.setState = {
      ...this.state,
      blocks,
    };
  };

  render() {
    return (
      <div>
        <DivBlock blocks={this.state.blocks} moveToNull={this.moveToNull} />
      </div>
    );
  }
}

export default App;
